import { Form, Input } from "antd";
import React from "react";

const AdminSkills = () => {
  return (
    <div>
      <p>Admin Skills</p>
      <Form>
        <Form.Item>
          <Input placeholder="title" />
        </Form.Item>
        <Form.Item>
          <Input type="file" placeholder="Images" />
        </Form.Item>
      </Form>
    </div>
  );
};

export default AdminSkills;
